import React, { useEffect } from 'react';
import auth from './service/authService';
import Channel from './components/Channel/Channel';

const App = () => {

  useEffect(() => {
    auth.login({
      email: 'email@gmail.com',
      password: 'password',
    });
  });

  return (
    <div>
      <Channel />
    </div>
  );
};

export default App;
